  position: absolute;
  width: 100vw;
  height: 100vh;
  background-color: red;
  display: flex;
  justify-content: center;
  align-items: center;
`;

interface Props {
  saveQuestionInState: (question: Question) => void;
}

export const QuestionSubForm: React.FC<Props> = ({ saveQuestionInState }) => {
  return (
    <Modal>
      <FormContainer>
        <h2>QUESTIOn</h2>
      </FormContainer>
    </Modal>
  );
};
